import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { withStyles } from '@mui/styles';
import {data} from '../../MockData/MockData'
import './ShoppingList.css'
const styles = theme => ({
  root: {
    display: 'flex',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'hide',
  },
  table: {
    minWidth: 340,
  },
  tableCell: {
    paddingRight: 4,
    paddingLeft: 5
  }
});
function ShoppingList(props) {
  const { classes } = props;
  return (
    <TableContainer id='shopping-list' component={Paper}  className={classes.root}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table" className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell>Product</TableCell>
            <TableCell align="right" className={classes.tableCell}>Price</TableCell>
            <TableCell align="right" className={classes.tableCell}>Quantity</TableCell>
            <TableCell align="right" className={classes.tableCell}>Subtotal</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.products.map((row) => {
            return <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row" className={`${classes.tableCell} product-field`}>
                <span className='prod-img'><img src={require(`../../static/images/${row.imageUrl}`).default} alt={row.name} /></span>
                <span>{row.name}
                  {row?.desc}
                </span>
              </TableCell>
              <TableCell align="right" className={classes.tableCell}>{row.price}</TableCell>
              <TableCell align="right" className={classes.tableCell}></TableCell>
              <TableCell align="right" className={classes.tableCell}></TableCell>
            </TableRow>
          })}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
export default withStyles(styles)(ShoppingList);
